sys_variable_value.value:
(function execute(inputs, outputs){
    var jobClass = inputs.script_fetch.sys_class_name;
    var trueLookup = new GlideRecord(jobClass);
    if (trueLookup.get(inputs.script_fetch)){
        outputs.passfail = 'pass';
        SncTriggerSynchronizer.executeNow(trueLookup);
    }else {
        outputs.passfail = 'fail';
    }

    
})(inputs, outputs);

